import React, { useState } from 'react';
import './registration.css';

const RegistrationForm = ({ onStudentRegistered }) => {
  const [formData, setFormData] = useState({
    room: '',
    sector: '',
    feePerMonth: '',
    stayFrom: '',
    duration: '',
    course: '',
    registrationNo: '',
    firstName: '',
    middleName: '',
    lastName: '',
    gender: '',
    contact: '',
    email: '',
    guardianName: '',
    guardianContact: '',
    permanentAddress: '',
    permanentCity: '',
    permanentState: '',
    permanentPincode: '',
  });

  const [searchQuery, setSearchQuery] = useState('');

  const handleChange = (e) => {
    const { name, value } = e.target;
    setFormData({
      ...formData,
      [name]: value,
    });
  };

  const handleSearchChange = (e) => {
    setSearchQuery(e.target.value);
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    try {
      const response = await fetch('http://localhost:8080/students/register', {
        method: 'POST',
        headers: {
          'Content-Type': 'application/json',
        },
        body: JSON.stringify(formData),
      });

      if (response.ok) {
        alert('Student registered successfully!');
        setFormData({
          room: '',
          sector: '',
          feePerMonth: '',
          stayFrom: '',
          duration: '',
          course: '',
          registrationNo: '',
          firstName: '',
          middleName: '',
          lastName: '',
          gender: '',
          contact: '',
          email: '',
          guardianName: '',
          guardianContact: '',
          permanentAddress: '',
          permanentCity: '',
          permanentState: '',
          permanentPincode: '',
        });
        if (onStudentRegistered) onStudentRegistered(); // Trigger parent action
      } else {
        alert('Failed to register the student');
      }
    } catch (error) {
      console.error('Error:', error);
      alert('An error occurred while registering the student');
    }
  };

  return (
    <div className="registration-container">
      <div className="search-bar">
        <input
          type="text"
          placeholder="Search for students..."
          value={searchQuery}
          onChange={handleSearchChange}
        />
      </div>
      <div className="registration-form">
        <h2>Student Registration</h2>
        <form onSubmit={handleSubmit}>
          <label>
            Room:
            <select name="room" value={formData.room} onChange={handleChange} required>
              <option value="">Select room type</option>
              <option value="Four cot">Four cot</option>
              <option value="Double cot">Double cot</option>
              <option value="Single cot">Single cot</option>
            </select>
          </label>
          <input
            type="text"
            name="sector"
            placeholder="Sector"
            value={formData.sector}
            onChange={handleChange}
          />
          <input
            type="number"
            name="feePerMonth"
            placeholder="Fee Payment"
            value={formData.feePerMonth}
            onChange={handleChange}
            required
          />
          <input
            type="date"
            name="stayFrom"
            value={formData.stayFrom}
            onChange={handleChange}
            required
          />
          <select name="duration" value={formData.duration} onChange={handleChange}>
            <option value="">Select stay duration</option>
            <option value="1">1 Month</option>
            <option value="3">3 Months</option>
            <option value="6">6 Months</option>
            <option value="12">12 Months</option>
          </select>
          <input
            type="text"
            name="firstName"
            placeholder="First Name"
            value={formData.firstName}
            onChange={handleChange}
            required
          />
          <select name="course" value={formData.course} onChange={handleChange}>
            <option value="">Select Department</option>
            <option value="CSE">CSE</option>
            <option value="IT">IT</option>
            <option value="ECE">ECE</option>
            <option value="EEE">EEE</option>
          </select>
          <input
            type="text"
            name="registrationNo"
            placeholder="Registration Number"
            value={formData.registrationNo}
            onChange={handleChange}
            required
          />
          <textarea
            name="permanentAddress"
            placeholder="Permanent Address"
            value={formData.permanentAddress}
            onChange={handleChange}
          />
          <button type="submit">Register</button>
        </form>
      </div>
    </div>
  );
};

export default RegistrationForm;
